import React from 'react';
import content from './content.js'

export default function Card(props) {
    return(
        <>
           <h1>{props.title}</h1>
           <p>{props.body}</p> 
           <img src={`./images/${props.image}`} alt="card-image"></img>
        </>
    )
}
